import React from 'react';
import PageTitle from '../../PageTitle';
import Rules from './Rules';
import Settings from './Settings';

const InactiveGame = () => {
  return (
    <>
      <PageTitle>Math Blitz</PageTitle>
      <Rules />
      <Settings />
    </>
  );
};

export default InactiveGame;
